import React from 'react';
import './footer.scss';

function Footer() {
    return (
        <div>
            <div>
                <p>Logo Kabayan</p>
                <p>Akun Media Sosial</p>
            </div>
            <div>
                <p>Copyright</p>
            </div>
        </div>
    )
}

export default Footer
